extras.func:
msg.texttowrite = msg.text.split('Issued: ',2);
msg.title = msg.texttowrite[1].split(' ');
var splittedStr = msg.title[1].split(' ');
var txt = msg.title[0] + " " + splittedStr[0];
msg.cellIssued = "A" + msg.rownumber;
msg.cellResult = "B" + msg.rownumber;
msg.rownumber += 1;
msg.value = txt.substring(0, txt.length - 9);
return msg;

